    "2013-03-14T19:23:32.703095",nt"name": "naip-aerial-imagery-resampled-salton-sea-2005-ds425",nt"isopen":
    false,nt"url": null,nt"notes": "NAIP 2005 aerial imagery that has been
    resampled from 1-meter source resolution to approximately 30-meter resolution. This
    is a mosaic composed from several NAIP 2005 County Mosaic images covering the Salton
    Sea vicinity. Black "no data" pixels can be seen at the junctions of some of the
    images. ArcMap was used to create this resampled image. First, an appropriate Salton
    Sea vicinity extent was displayed in ArcMap, then the original NAIP 2005 County
    Mosaic images were added as layers, the black "no data" pixels were attempted
    to be made transparent (didn't work completely), the data frame was set to California
    Teale Albers NAD83 and then exported to a georeferenced TIFF image at 600 DPI. Update:
    This is a second version of the image. This version has a larger extent than the
    previous version.",nt"license_title": null,nt"extras": [{ntt"key":
